import './Login.css';

function Login() {
  return (
    <div>
        <div className="login">
            Login Here!
        </div>
        <div className="container">
            <div>
                Enter Username: <br/>
                <input></input>
            </div>
            <div>
                Enter Password: <br/>
                <input></input>
            </div>
        </div>
    </div>
  );
}

export default Login;
